import { Component } from "react";
import axios from '../conexion';

/*const */

class Ingreso extends Component{  
    constructor(props){
        super(props);
        this.state={
            click: false
        }
    }

    ingresar =async (email,pass)=>{
        await axios.post('http://localhost:3200/api/user/login',{
            Body:{
                UsEmail: email,
                UsPass: pass
            }
        }).then(function (response) {
            console.log(response);
        })
        
    }
    
    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email' ></input><br/>
                    pass: <input type='password' className="element" id='pass' ></input><br/>
                </form>
                <button className="element" onClick={()=>{this.setState({click: true}); this.ingresar()}}>Ingresar</button>
            </div>
        )
    }

    
}

export default Ingreso;
